  \"2016-05-25T00:52:35.304949\",\n\t\"name\": \"departure-spacing-program\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Departure Spacing Program (DSP), sometimes
  called the Departure Sequencing Program, is deployed in the Northeastern U.S. Air
  Traffic Corridor. DSP evaluates aircraft departure flight plans at participating
  airports, models projected aircraft demand at departure resources such as first
  and second departure fixes, and provides windows of departure times to controllers.
  DSP displays current and predicted departure fix demand as well as allows traffic
  managers to make departure fix flow rate adjustments. The Flow Forecast Display
  indicates the number of aircraft projected to cross each DSP departure flow fix
  for the next one-hour period in 15-minute increments. It also provides information
  on any fix flow rate restrictions in effect.DSP interfaces with Flight Strip Printer
  (part of the Display System Replacement (DSR)) in New York ARTCC Pit in order to
  obtain full flight strip information for display in DSP to air traffic controllers.
  \ Also, DSP has a KVDT emulation program whereby\",\n\t\"license_title\": \"Other
